import React from "react";
import "./contact.css";
import twitter from "./icon/twitter.png";
function Contact() {
  return (
    <>
      <div className="heading">Contact</div>
      <div className="socialimg">
        <img src={twitter}></img>
      </div>
    </>
  );
}

export default Contact;
